/// You may register:
/// <ul>
///   <li>
///     A transparent overlay used to capture user taps.
///   </li>
///   <li>
///     Transient buttons such as:
///     <ul>
///       <li>
///         Pause
///       </li>
///       <li>
///         Play
///       </li>
///       <li>
///         Fullscreen
///       </li>
///       <li>
///         Cast/AirPlay
///       </li>
///       <li>
///         Collapse
///       </li>
///       <li>
///         Progress/Seek
///       </li>
///       <li>
///         Other playback relevant actions
///       </li>
///     </ul>
///   </li>
/// </ul>
/// You must NOT register:
/// <ul>
///   <li>
///     Watermarks
///   </li>
///   <li>
///     Pop ups
///   </li>
///   <li>
///     Dialogs
///   </li>
///   <li>
///     Non-transient buttons
///   </li>
///   <li>
///     Other obscuring views
///   </li>
/// </ul>
